import Background from './nftttt.jpg';
import './App.css';

function Home() {
  return (
    <body className="home" style={{overflow:'inherit'}}>

      <div className='bg-image'>
      </div>

      <div className='bg-image2'>
        <img className='shadow_image' style={{borderRadius:'20px'}} src="https://lh3.googleusercontent.com/aXIeaukiZBG1OlIqkfo5j1Z63P060AlM2Qko9eIaN4s8UXPBDAGfErwSh4KrCAec6K23l8KOJQWeEcEmEOU5FFWAuO-Dg50wQlY4TCI=s550"/>
      </div>      

    </body>
  );
}

export default Home;
